import React from 'react';

export const Header = () => {
  return (
    <header className="">
        <div className="py-2 px-6 border-b-2 border-zinc-100 flex justify-between align-middle">
          <h1 className=" px-3 text-2xl font-bold text-zinc-100">CareerCrafter©️</h1>
          <div className='flex gap-5 justify-between -translate-x-64 py-2 px-3'>
          <div className="text-base  text-zinc-100">Home</div>
          <div className="text-base  text-zinc-100">Dash Board</div>
          </div>
          <div className='flex gap-5 py-2 px-5'>
          <div className="text-base  text-zinc-100">Log In</div>
          <div className="text-base  text-zinc-100">Sign Up In</div>
          </div>
        </div>
      </header>
  );
};
